import React from 'react'
import styled from 'styled-components'

const Container = styled.div`
display:flex;
gap:24px;
`;
const Content = styled.div`
flex:5;

`;
const Recom = styled.div`
flex:2;
`;


export default function Video() {
  return (
    <Container>
      <Content>CONTENT</Content>
      <Recom>Recom</Recom>
    </Container>
  )
}
